import React from "react"

type ListTask = {
    list: string[]
}



export default function TaskList(list: ListTask){



    return (<>

    {list.list.map((nameTask, index) => (
        <li key={index} className="w-full py-5 flex items-start px-4 laila-semibold bg-white border border-slate-200 rounded-lg">
                    <div className="w-1/2 h-full flex flex-col items-start">
                    <span>{nameTask}</span>
                    </div>
                    <div className="w-1/2 h-full">

                                    <button className="w-max h-max p-2 bg-gree">Assign</button>
                    </div>
        </li>
    ))}
    </>)
}
